import React from 'react';

function ProductList({ products, onAddToCart }) {
  return (
    <div className="container">
      <div className="row">
        {products.map(product => (
          <div key={product.id} className="col-md-4 mb-4">
            <div className="card">
              <div className="card-body">
                <h5 className="card-title">{product.name}</h5>
                <p className="card-text">{product.price} SEK</p>
                <p className="card-text">{product.description}</p> {/* Lägg till denna rad för att visa produktbeskrivningen */}
                {product.isBestseller && <span className="badge bg-success">Bästsäljare</span>} {/* Lägg till denna rad för att markera bästsäljare */}
                <button onClick={() => onAddToCart(product)} className="btn btn-primary">Lägg till i kundvagn</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default ProductList;
